import React from "react";
import axios from "axios";

async function Test(){
    try {
        const result = await axios.get(`https://frontend-educational-backend.herokuapp.com/api/test/all`);
        console.log(result);


    } catch (e) {
        console.error(e);

    }
}


export default Test;
